// Normalize bios from “Research Attendee (Agent)”
// Works even if each item only has { output: "<bio text>" }.
// If you also connect Input 1 with “Slim Inputs for Agent” (items with {name,email,domain}),
// this node will align by index and/or fuzzy name to fill missing emails.
//
// Output (one per person):
//   { emailLower?, email?, name?, domain?, bio, nameKey? }
//
// You can merge later by `emailLower` (preferred) and fall back to `nameKey` if email is missing.

function clean(s){ return typeof s === 'string' ? s.trim() : ''; }
function lower(s){ return typeof s === 'string' ? s.toLowerCase() : ''; }

// --- regex helpers ---
var EMAIL_RE = /[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,}/ig;
var HOST_RE  = /\b((?:[a-z0-9-]+\.)+[a-z]{2,})\b/ig;

// strip ``` fences and collapse whitespace a bit
function normalizeText(t){
  var txt = String(t == null ? '' : t);
  if (txt.indexOf('```') > -1) {
    txt = txt.replace(/```json/ig,'').replace(/```/g,'');
  }
  // trim line ends, collapse >2 newlines to 2
  txt = txt.split('\n').map(function(l){ return l.replace(/\s+$/,''); }).join('\n');
  txt = txt.replace(/\n{3,}/g, '\n\n');
  return txt.trim();
}

// naive name guess: take leading fragment before " is " or first line
function guessNameFromBio(txt){
  var t = clean(txt);
  if (!t) return '';
  var firstLine = t.split('\n')[0];
  var beforeIs = firstLine.toString().split(/\s+is\s+/i)[0];
  var cand = clean(beforeIs.length >= 3 ? beforeIs : firstLine);
  // Keep it reasonable: 2–5 words, title-case-ish
  var words = cand.split(/\s+/).filter(Boolean);
  if (words.length > 6) words = words.slice(0,6);
  // If it's something like "Founder and director", that's not a name; reject if no capital letter start
  var hasCap = /^[A-Z]/.test(words[0] || '');
  return hasCap ? words.join(' ') : '';
}

function extractEmailFromText(txt){
  var m = String(txt||'').match(EMAIL_RE);
  return (m && m.length) ? m[0] : '';
}

function extractDomainFromText(txt){
  // pick a plausible company domain; ignore common service hosts
  var IGNORE = { 'www.google.com':1,'linkedin.com':1,'www.linkedin.com':1,'twitter.com':1,'x.com':1,'facebook.com':1,'instagram.com':1,'youtube.com':1,'outlook.office365.com':1,'microsoft.com':1,'github.com':1,'medium.com':1 };
  var hosts = []; var h;
  var text = String(txt||'');
  while ((h = HOST_RE.exec(text)) !== null){
    var host = h[1].toLowerCase();
    if (!IGNORE[host]) hosts.push(host);
  }
  // Return the most frequent non-ignored host if any
  if (hosts.length === 0) return '';
  var freq = {}; var best = '', bestN = -1;
  for (var i=0;i<hosts.length;i++){ var k=hosts[i]; freq[k]=(freq[k]||0)+1; if (freq[k]>bestN){ bestN=freq[k]; best=k; } }
  return best;
}

function domainFromEmail(email){
  var e = lower(clean(email)); var at = e.indexOf('@'); return at>-1 ? e.slice(at+1) : '';
}

// --- collect inputs ---
var outItems = ($input.all(0) || []).map(function(i){ return i.json; });
var hintItems = []; try { hintItems = ($input.all(1) || []).map(function(i){ return i.json; }); } catch(_){}

// Build hint maps (by index, by lower(name), by lower(email))
var hintsByIndex = hintItems;
var hintsByName  = {};
var hintsByEmail = {};
for (var hi=0; hi<hintItems.length; hi++){
  var h = hintItems[hi] || {};
  var hEmail = clean(h.email || (h.emailAddress && h.emailAddress.address) || '');
  var hName  = clean(h.name || h.person || h.fullName || h.attendeeName || '');
  if (hName) hintsByName[lower(hName)] = h;
  if (hEmail) hintsByEmail[lower(hEmail)] = h;
}

// Process each research output
var results = [];

for (var i=0; i<outItems.length; i++){
  var row = outItems[i] || {};
  var bioRaw = (row.bio !== undefined ? row.bio : (row.output !== undefined ? row.output : (row.text !== undefined ? row.text : row.content)));
  var bio = normalizeText(bioRaw);

  // Try to resolve identity
  var email = extractEmailFromText(bio);
  var name  = '';
  var domain = '';

  // If no email in text, try to align with hints
  if (!email && hintsByIndex[i]){
    var h = hintsByIndex[i];
    var hEmail = clean(h.email || (h.emailAddress && h.emailAddress.address) || '');
    if (hEmail) email = hEmail;
    name = clean(h.name || h.person || h.fullName || h.attendeeName || '');
    domain = clean(h.domain || '');
  }

  // If still no email, try name-match from text → hintsByName
  if (!email){
    var guessName = guessNameFromBio(bio);
    if (guessName && hintsByName[lower(guessName)]){
      var hh = hintsByName[lower(guessName)];
      email = clean(hh.email || (hh.emailAddress && hh.emailAddress.address) || '');
      if (!name) name = clean(hh.name || hh.person || hh.fullName || hh.attendeeName || guessName);
      if (!domain) domain = clean(hh.domain || '');
    } else if (guessName) {
      name = name || guessName;
    }
  }

  // Derive domain if still missing
  if (!domain){
    if (email) domain = domainFromEmail(email);
    if (!domain){
      var dTxt = extractDomainFromText(bio);
      if (dTxt) domain = dTxt;
    }
  }

  // Fallback name if still empty
  if (!name) name = guessNameFromBio(bio);

  var emailLower = lower(email);
  var nameKey = lower(clean(name));

  results.push({
    emailLower: emailLower || '',
    email: email || '',
    name: name || '',
    domain: domain || '',
    nameKey: nameKey || '',
    bio: bio
  });
}

// Deduplicate by emailLower if available; else by nameKey
var bestByKey = {};
for (var r=0; r<results.length; r++){
  var it = results[r];
  var key = it.emailLower || ('name:' + it.nameKey);
  if (!key) continue;
  var prev = bestByKey[key];
  if (!prev || it.bio.length > prev.bio.length){
    bestByKey[key] = it;
    // prefer real email if one version had none
    if (prev && !prev.email && it.email) bestByKey[key].email = it.email;
    if (prev && !prev.domain && it.domain) bestByKey[key].domain = it.domain;
  } else {
    // keep better name if longer
    if (it.name && (!prev.name || it.name.length > prev.name.length)) bestByKey[key].name = it.name;
    if (it.domain && !prev.domain) bestByKey[key].domain = it.domain;
    if (it.email && !prev.email) bestByKey[key].email = it.email;
  }
}

// Emit items
var out = [];
for (var k in bestByKey){
  out.push({ json: bestByKey[k] });
}

if (out.length === 0){
  // Emit diagnostics to help wire Input 1 properly
  return [{
    json: {
      warning: "No usable bios (no email/name could be resolved). Consider connecting Slim Inputs as Input 1.",
      sampleKeys: Object.keys(outItems[0] || {}),
      note: "If Agent output only has 'output' text, merge with Slim Inputs by index so we can attach emails."
    }
  }];
}

return out;

// ---------- helpers ----------
function clean(s){ return typeof s === 'string' ? s.trim() : ''; }
function lower(s){ return typeof s === 'string' ? s.toLowerCase() : ''; }
function get(o, path, d){
  var parts = path.split('.'); var cur = o;
  for (var i=0;i<parts.length;i++){ 
    var k=parts[i]; 
    if (cur && typeof cur==='object' && (k in cur)) cur = cur[k]; 
    else return d; 
  }
  return cur;
}
function domainFromEmail(email){
  var e = lower(clean(email)); 
  var at = e.indexOf('@'); 
  return at>-1 ? e.slice(at+1) : '';
}
function normalizeIso(s){
  s = clean(s); if (!s) return null;
  var t = s.replace(/Z$/,''); var dot = t.indexOf('.');
  if (dot>-1) t = t.slice(0,dot);
  if (t.length>=19) t = t.slice(0,19); // YYYY-MM-DDTHH:MM:SS
  return t;
}
function isoFromEpochSec(sec){
  if (typeof sec !== 'number') return null;
  var d = new Date(sec*1000);
  var yyyy = d.getUTCFullYear();
  var mm = String(d.getUTCMonth()+1).padStart(2,'0');
  var dd = String(d.getUTCDate()).padStart(2,'0');
  var hh = String(d.getUTCHours()).padStart(2,'0');
  var mi = String(d.getUTCMinutes()).padStart(2,'0');
  var ss = String(d.getUTCSeconds()).padStart(2,'0');
  return yyyy+'-'+mm+'-'+dd+'T'+hh+':'+mi+':'+ss;
}
function startISO(ev){
  var s1 = get(ev,'start.dateTime', null); if (s1) return normalizeIso(String(s1));
  var s2 = ev.startISO || get(ev,'start', null); if (typeof s2 === 'string') return normalizeIso(s2);
  var e  = (typeof ev.epoch === 'number') ? ev.epoch : get(ev,'start.epoch', null);
  if (typeof e === 'number') return normalizeIso(isoFromEpochSec(e));
  return null;
}
function endISO(ev){
  var e1 = get(ev,'end.dateTime', null); if (e1) return normalizeIso(String(e1));
  var e2 = ev.endISO || get(ev,'end', null); if (typeof e2 === 'string') return normalizeIso(e2);
  var ee = get(ev,'end.epoch', null);
  if (typeof ee === 'number') return normalizeIso(isoFromEpochSec(ee));
  return null;
}
function titleCase(s){
  return s.split(/\s+/).filter(Boolean).map(function(w){
    return w.charAt(0).toUpperCase() + w.slice(1);
  }).join(' ');
}
function inferCompanyFromDomain(domain){
  domain = lower(clean(domain || ''));
  if (!domain) return '';
  var IGNORE = {
    'gmail.com':1,'googlemail.com':1,'yahoo.com':1,'hotmail.com':1,'outlook.com':1,'live.com':1,
    'msn.com':1,'icloud.com':1,'me.com':1,'proton.me':1,'protonmail.com':1,'gmx.com':1,'aol.com':1
  };
  if (IGNORE[domain]) return '';
  var d = domain.replace(/^(mail|owa|webmail|mx|smtp|imap|app|portal|m|eu|us)\./, '');
  var multiTLDs = ['co.uk','com.au','com.br','com.ar','com.mx','co.jp','co.in','com.sg','com.hk','com.tr','com.cn','co.nz'];
  for (var i=0;i<multiTLDs.length;i++){
    var tld = multiTLDs[i];
    if (d.endsWith('.' + tld)){
      var base = d.slice(0, -(tld.length + 1));
      var parts = base.split('.');
      var label = parts[parts.length - 1] || base;
      return titleCase(label.replace(/-/g,' '));
    }
  }
  var parts2 = d.split('.');
  if (parts2.length >= 2){
    var core = parts2[parts2.length - 2];
    return titleCase(core.replace(/-/g,' '));
  }
  return titleCase(d.replace(/-/g,' '));
}
function extractJobTitles(text){
  var t = ' ' + clean(text) + ' ';
  if (!t) return [];
  var pats = [
    /\bChief\s+[A-Za-z&\- ]{2,30}\b/gi,
    /\b(CFO|CEO|COO|CTO|CIO|CMO|CPO|CISO|GC)\b/gi,
    /\b(SVP|EVP|VP|Assoc\.?\s?VP|Vice\s+President)\b/gi,
    /\bManaging\s+Director\b/gi,
    /\bDirector(?:\s+of\s+[A-Za-z&\- ]{2,40})?\b/gi,
    /\bHead\s+of\s+[A-Za-z&\- ]{2,40}\b/gi,
    /\bGlobal\s+Head\s+of\s+[A-Za-z&\- ]{2,40}\b/gi,
    /\bPartner\b/gi,
    /\b(Associate\s+Director|Senior\s+Manager|Manager)\b/gi,
    /\b(Consultant|Principal)\b/gi,
    /\b(General\s+Counsel|Legal\s+Counsel|Counsel|Attorney|Solicitor|Barrister)\b/gi,
    /\b(Product|Engineering|Sales|Marketing|Operations|Finance|HR|People|Data|Design)\s+(Manager|Director|Lead|Head)\b/gi,
    /\b(Account\s+Executive|Business\s+Development|Recruiter)\b/gi
  ];
  var found = [];
  for (var i=0;i<pats.length;i++){
    var re = pats[i], m;
    while ((m = re.exec(t)) !== null){
      var val = clean(m[0]);
      if (val && found.indexOf(val) === -1) found.push(val);
    }
  }
  return found;
}

// ---------- main ----------
var items = $input.all().map(function(i){ return i.json || {}; });
var out = [];

for (var i=0;i<items.length;i++){
  var ev = items[i] || {};

  var meetingId = ev.id || ev.eventId || null;
  var subject = clean(ev.subject || ev.Subject || '(No subject)');
  var bodyPreview = clean(ev.description || ev.bodyPreview || '');
  var jobTitles = extractJobTitles(bodyPreview);

  var sISO = startISO(ev);
  var eISO = endISO(ev);
  var tz = get(ev,'start.timeZone', get(ev,'time.timeZone', get(ev,'end.timeZone','UTC')));

  var attendeesRaw = Array.isArray(ev.attendees) ? ev.attendees : [];
  var attendees = [];
  for (var a=0; a<attendeesRaw.length; a++){
    var att = attendeesRaw[a] || {};
    var email = clean(att.email || get(att,'emailAddress.address',''));
    var name  = clean(att.name || get(att,'emailAddress.name','') || (email ? email.split('@')[0] : ''));
    var domain = domainFromEmail(email);
    var company = inferCompanyFromDomain(domain);
    var type = clean(att.type || '');
    var response = clean(att.response || get(att,'status.response','') || '');
    var respondedAt = clean(att.respondedAt || get(att,'status.time','') || '');

    if (!name && !email) continue;

    attendees.push({
      name: name,
      email: email,
      domain: domain,
      company: company,
      type: type,
      response: response,
      respondedAt: respondedAt
    });
  }

  attendees.sort(function(a,b){
    var n = (a.name||'').localeCompare(b.name||''); 
    return n!==0 ? n : (a.email||'').localeCompare(b.email||'');
  });

  out.push({
    json: {
      meetingId: meetingId,
      meetingSubject: subject,
      startISO: sISO,
      endISO: eISO,
      timeZone: tz,
      bodyPreview: bodyPreview,
      jobTitles: jobTitles,
      attendees: attendees
    }
  });
}

// ---- SORT MEETINGS BY DATE ----
// Ascending (earliest → latest)
out.sort(function(a, b) {
  var da = new Date(a.json.startISO || 0);
  var db = new Date(b.json.startISO || 0);
  return da - db;
});

// For most recent first, swap to: return db - da;

return out.length ? out : [{ json: { warning: 'No meetings found in input' } }];

/**
 * Filters meetings to only those with external attendees,
 * adds inferred company domain(s) and company name(s) from those domains.
 */

// >>> Set your internal domains here (lowercase). Add more if needed.
const internalDomains = ['legalengine.co.uk'];

// --- helpers ---
function getEmail(att) {
  return (
    (att && (
      att.email ||
      att.address ||
      att.mail ||
      att.userPrincipalName ||
      (att.emailAddress && (att.emailAddress.address || att.emailAddress.email)) ||
      ''
    )) || ''
  ).toLowerCase();
}

function getName(att) {
  return (
    (att && (
      att.name ||
      att.displayName ||
      (att.emailAddress && att.emailAddress.name) ||
      ''
    )) || ''
  ).toString();
}

function isExternal(att) {
  const email = getEmail(att);
  if (email && internalDomains.length) {
    const domain = email.split('@')[1] ? email.split('@')[1].toLowerCase() : '';
    if (domain) return !internalDomains.includes(domain);
  }
  const flag =
    att?.isExternal === true ||
    att?.external === true ||
    /external/i.test(String(att?.type || '')) ||
    /external/i.test(String(att?.role || ''));
  return !!flag;
}

function pick(...vals) {
  return vals.find(v => v !== undefined && v !== null && v !== '') ?? null;
}

// Infer a company name from a domain (very basic heuristic)
function inferCompanyName(domain) {
  if (!domain) return null;
  // Strip common TLDs and SLDs
  const parts = domain.split('.');
  if (parts.length < 2) return domain;
  // Remove last part (TLD)
  parts.pop();
  // If second-level TLD (e.g. co.uk), remove again
  if (['co', 'com', 'org', 'net'].includes(parts[parts.length - 1])) {
    parts.pop();
  }
  return parts[parts.length - 1] || domain;
}

// --- main ---
const out = [];

for (const { json: m } of items) {
  const attendees = Array.isArray(m.attendees) ? m.attendees : [];
  if (!attendees.length) continue;

  const externals = attendees.filter(isExternal);
  if (!externals.length) continue;

  const allNames = attendees.map(getName).filter(Boolean);
  const allEmails = attendees.map(getEmail).filter(Boolean);
  const externalNames = externals.map(getName).filter(Boolean);
  const externalEmails = externals.map(getEmail).filter(Boolean);

  // Extract domains from external emails
  const externalDomains = Array.from(
    new Set(
      externalEmails
        .map(e => e.split('@')[1] || null)
        .filter(Boolean)
    )
  );

  // Infer company names
  const inferredCompanyNames = externalDomains
    .map(inferCompanyName)
    .filter(Boolean);

  out.push({
    json: {
      id: pick(m.meetingId, m.id),
      subject: pick(m.meetingSubject, m.subject, m.title),
      start: pick(m.startISO, m.start, m.startTime),
      end: pick(m.endISO, m.end, m.endTime),
      timeZone: pick(m.timeZone, m.timezone),
      attendeesCount: attendees.length,
      hasExternalAttendees: true,

      // Attendees (all)
      attendeeNames: allNames,
      attendeeEmails: allEmails,

      // External attendees
      externalAttendeeNames: externalNames,
      externalAttendeeEmails: externalEmails,

      // Inferred company info
      inferredCompanyDomains: externalDomains,
      inferredCompanyNames: inferredCompanyNames,

      // Optional pass-through
      organizer: m.organizer ?? null,
      location: m.location ?? null,
      bodyPreview: m.bodyPreview ?? null,
      link: m.link ?? m.meetingLink ?? null,
    }
  });
}

return out;

return [
  {
    json: items[items.length - 1].json   // keeps only the last output
  }
];

// One row per unique attendee email, pulled from prior node "Split Into indiv Inputs".

// ---------- helpers ----------
function toHostname(input) {
  if (!input) return null;
  var s = String(input).trim().toLowerCase();
  if (s.indexOf('@') !== -1) s = s.split('@').pop(); // email -> domain
  s = s.replace(/^mailto:/, '').replace(/^@/, '').replace(/^<|>$/g, '');
  try {
    if (s.indexOf('/') !== -1 || s.indexOf('://') !== -1) {
      var u = new URL(s.indexOf('://') !== -1 ? s : 'http://' + s);
      s = u.hostname || s;
    }
  } catch (e) {}
  return s.replace(/\.+$/, '') || null; // trim trailing dots
}

function inferCompanyNameFromDomain(domain) {
  if (!domain) return '';
  var parts = String(domain).toLowerCase().split('.').filter(Boolean);
  if (!parts.length) return '';
  parts.pop(); // drop TLD
  if (parts.length && ['co','com','org','net'].indexOf(parts[parts.length - 1]) !== -1) parts.pop();
  return parts[parts.length - 1] || '';
}

function tsOf(v) {
  if (!v) return 0;
  var t = Date.parse(v);
  return isNaN(t) ? 0 : t;
}

// ---------- load ALL available runs from prior node ----------
var priorItems = [];
var maxRuns = (typeof $runIndex === 'number') ? $runIndex : 0;
for (var ri = 0; ri <= maxRuns; ri++) {
  try {
    var chunk = $items('Split Into indiv Inputs', 0, ri) || [];
    if (Array.isArray(chunk) && chunk.length) priorItems = priorItems.concat(chunk);
  } catch (e) {}
}
// fallback single attempt
if (!priorItems.length) {
  try {
    var chunk0 = $items('Split Into indiv Inputs', 0, 0) || [];
    if (Array.isArray(chunk0) && chunk0.length) priorItems = chunk0;
  } catch (e) {}
}

if (!Array.isArray(priorItems) || !priorItems.length) {
  return [{ json: { warning: 'No items found from "Split Into indiv Inputs"' } }];
}

// ---------- dedupe by attendeeEmail (keep the latest by start) ----------
var byEmail = new Map();

for (var i = 0; i < priorItems.length; i++) {
  var row = (priorItems[i] && priorItems[i].json) ? priorItems[i].json : {};
  var email = (row.attendeeEmail || '').trim();
  if (!email) continue;
  var key = email.toLowerCase();

  // derive/fix domain & company if missing
  var domain = row.inferredCompanyDomain || toHostname(email) || '';
  var company = row.inferredCompanyName || inferCompanyNameFromDomain(domain) || '';

  var current = byEmail.get(key);
  var candidate = {
    subject: row.subject || row.meetingSubject || '',
    attendeeName: row.attendeeName || '',
    attendeeEmail: email,
    inferredCompanyName: company,
    inferredCompanyDomain: domain,
    meetingId: row.meetingId || row.id || '',
    start: row.start || row.startISO || row.startTime || '',
    end: row.end || row.endISO || row.endTime || '',
    timeZone: row.timeZone || row.timezone || ''
  };

  if (!current) {
    byEmail.set(key, candidate);
  } else {
    // keep the one with the later start timestamp
    if (tsOf(candidate.start) >= tsOf(current.start)) byEmail.set(key, candidate);
  }
}

// ---------- output ----------
var out = [];
byEmail.forEach(function(v) { out.push({ json: v }); });

return out.length ? out : [{ json: { warning: 'No attendee emails after dedupe' } }];

// Input: one item per meeting with arrays like:
// externalAttendeeNames, externalAttendeeEmails, inferredCompanyDomains, inferredCompanyNames, subject, ...
const it = $input.item.json;

const names  = Array.isArray(it.externalAttendeeNames)  ? it.externalAttendeeNames  : [];
const emails = Array.isArray(it.externalAttendeeEmails) ? it.externalAttendeeEmails : [];
const domains = Array.isArray(it.inferredCompanyDomains) ? it.inferredCompanyDomains : [];
const companies = Array.isArray(it.inferredCompanyNames) ? it.inferredCompanyNames : [];

const out = [];

for (let i = 0; i < Math.max(names.length, emails.length); i++) {
  const name  = names[i]  ?? '';
  const email = emails[i] ?? '';
  // Pick the first inferred company/domain if you don’t have a 1:1 mapping
  const company = companies[i] ?? companies[0] ?? '';
  const domain  = domains[i]  ?? domains[0]  ?? '';

  out.push({
    json: {
      subject: it.subject ?? it.meetingSubject ?? '',
      attendeeName: name,
      attendeeEmail: email,
      inferredCompanyName: company,
      inferredCompanyDomain: domain,

      // pass-throughs if useful
      meetingId: it.id ?? it.meetingId ?? '',
      start: it.start ?? it.startISO ?? '',
      end: it.end ?? it.endISO ?? '',
    }
  });
}

return out.length ? out : [{ json: { warning: "No external attendees to process" } }];

// Normalize bios from “Research Attendee (Agent)”
// Works even if each item only has { output: "<bio text>" }.
// If you also connect Input 1 with “Slim Inputs for Agent” (items with {name,email,domain}),
// this node will align by index and/or fuzzy name to fill missing emails.
//
// Output (one per person):
//   { emailLower?, email?, name?, domain?, bio, nameKey? }
//
// You can merge later by `emailLower` (preferred) and fall back to `nameKey` if email is missing.

function clean(s){ return typeof s === 'string' ? s.trim() : ''; }
function lower(s){ return typeof s === 'string' ? s.toLowerCase() : ''; }

// --- regex helpers ---
var EMAIL_RE = /[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,}/ig;
var HOST_RE  = /\b((?:[a-z0-9-]+\.)+[a-z]{2,})\b/ig;

// strip ``` fences and collapse whitespace a bit
function normalizeText(t){
  var txt = String(t == null ? '' : t);
  if (txt.indexOf('```') > -1) {
    txt = txt.replace(/```json/ig,'').replace(/```/g,'');
  }
  // trim line ends, collapse >2 newlines to 2
  txt = txt.split('\n').map(function(l){ return l.replace(/\s+$/,''); }).join('\n');
  txt = txt.replace(/\n{3,}/g, '\n\n');
  return txt.trim();
}

// naive name guess: take leading fragment before " is " or first line
function guessNameFromBio(txt){
  var t = clean(txt);
  if (!t) return '';
  var firstLine = t.split('\n')[0];
  var beforeIs = firstLine.toString().split(/\s+is\s+/i)[0];
  var cand = clean(beforeIs.length >= 3 ? beforeIs : firstLine);
  // Keep it reasonable: 2–5 words, title-case-ish
  var words = cand.split(/\s+/).filter(Boolean);
  if (words.length > 6) words = words.slice(0,6);
  // If it's something like "Founder and director", that's not a name; reject if no capital letter start
  var hasCap = /^[A-Z]/.test(words[0] || '');
  return hasCap ? words.join(' ') : '';
}

function extractEmailFromText(txt){
  var m = String(txt||'').match(EMAIL_RE);
  return (m && m.length) ? m[0] : '';
}

function extractDomainFromText(txt){
  // pick a plausible company domain; ignore common service hosts
  var IGNORE = { 'www.google.com':1,'linkedin.com':1,'www.linkedin.com':1,'twitter.com':1,'x.com':1,'facebook.com':1,'instagram.com':1,'youtube.com':1,'outlook.office365.com':1,'microsoft.com':1,'github.com':1,'medium.com':1 };
  var hosts = []; var h;
  var text = String(txt||'');
  while ((h = HOST_RE.exec(text)) !== null){
    var host = h[1].toLowerCase();
    if (!IGNORE[host]) hosts.push(host);
  }
  // Return the most frequent non-ignored host if any
  if (hosts.length === 0) return '';
  var freq = {}; var best = '', bestN = -1;
  for (var i=0;i<hosts.length;i++){ var k=hosts[i]; freq[k]=(freq[k]||0)+1; if (freq[k]>bestN){ bestN=freq[k]; best=k; } }
  return best;
}

function domainFromEmail(email){
  var e = lower(clean(email)); var at = e.indexOf('@'); return at>-1 ? e.slice(at+1) : '';
}

