// Collect all "output" strings from all incoming items and return ONE item with a clean text stream.

function safeParse(x) {
  if (x == null) return null;
  if (typeof x === 'object') return x;
  if (typeof x === 'string') { try { return JSON.parse(x); } catch { return null; } }
  return null;
}

function collectOutputs(obj, out) {
  if (!obj) return;
  if (typeof obj === 'string') {
    const parsed = safeParse(obj);
    if (parsed) { collectOutputs(parsed, out); return; }
    // plain string fallback
    const s = obj.trim();
    if (s) out.push(s);
    return;
  }
  if (Array.isArray(obj)) { obj.forEach(v => collectOutputs(v, out)); return; }

  // object
  if (typeof obj.output === 'string' && obj.output.trim()) out.push(obj.output.trim());
  if (Array.isArray(obj.data)) obj.data.forEach(v => collectOutputs(v, out));

  // scan other properties just in case
  for (const k of Object.keys(obj)) {
    if (k === 'data' || k === 'output') continue;
    const v = obj[k];
    if (typeof v === 'string' || Array.isArray(v) || (v && typeof v === 'object')) {
      collectOutputs(v, out);
    }
  }
}

const items = $input.all();
const outputs = [];
for (const it of items) {
  collectOutputs(it.json, outputs);
}

// de-dup consecutive identical blocks; keep order
const merged = [];
for (const s of outputs) {
  if (merged.length === 0 || merged[merged.length - 1] !== s) merged.push(s);
}

// Build single text stream
const text = merged.join('\n\n---\n\n') || 'No output text found.';

return [{ json: { text } }];

// Extract organiser details from a Microsoft Graph Calendar event (fast & robust).
// Output: ONE item with organiser-prefixed fields.

const it = $input.item.json;

// ---------- helpers ----------
const val = (s) => (typeof s === 'string' ? s.trim() : '');
const low = (s) => (typeof s === 'string' ? s.toLowerCase() : s);
const looksEmail = (s) => /@/.test(s);

function splitName(fullName) {
  const parts = (fullName || '').trim().split(/\s+/).filter(Boolean);
  if (!parts.length) return { firstName: '', lastName: '' };
  if (parts.length === 1) return { firstName: parts[0], lastName: '' };
  return { firstName: parts[0], lastName: parts.slice(1).join(' ') };
}

function inferOrgFromEmail(email) {
  const m = (email || '').toLowerCase().match(/@([^@]+)$/);
  if (!m) return '';
  const firstLabel = m[1].split('.')[0]; // first DNS label
  return firstLabel
    .split('-')
    .filter(Boolean)
    .map(w => w.charAt(0).toUpperCase() + w.slice(1))
    .join(' ');
}

// Reads either a true array at obj[key] or flattened keys like key[0], key[1], ...
function getIndexedArray(obj, baseKey) {
  const direct = obj?.[baseKey];
  if (Array.isArray(direct)) return direct.slice();

  const arr = [];
  for (const k of Object.keys(obj || {})) {
    if (!k.startsWith(baseKey + '[')) continue;
    const m = k.match(new RegExp(`^${baseKey}\\[(\\d+)\\]$`));
    if (m) {
      const idx = Number(m[1]);
      if (!Number.isNaN(idx)) arr[idx] = obj[k];
    }
  }
  return arr;
}

function pickFirst(arr) {
  return Array.isArray(arr) && arr.length ? val(arr[0]) : '';
}

// ---------- pass-throughs (Graph fields first) ----------
const subject   = it.subject ?? it.meetingSubject ?? '';
const meetingId = it.id ?? it.meetingId ?? '';
const start     = (it.start && (it.start.dateTime || it.start)) ?? it.startISO ?? '';
const end       = (it.end && (it.end.dateTime || it.end)) ?? it.endISO ?? '';
const timeZone  = (it.start && it.start.timeZone) || it.timeZone || '';

// ---------- primary: Graph organiser ----------
let organiserFullName = '';
let organiserEmail = '';
let organiserJobTitle = '';
let organiserOrganisation = '';

// Graph-style organiser
if (it.organizer && typeof it.organizer === 'object') {
  const ea = it.organizer.emailAddress || it.organizer.email || it.organizer.mail || {};
  if (typeof ea === 'object') {
    organiserFullName = val(ea.name || ea.displayName || '');
    organiserEmail    = low(val(ea.address || ea.emailAddress || ''));
  } else if (typeof ea === 'string') {
    if (ea.includes('@')) organiserEmail = low(val(ea));
    else organiserFullName = val(ea);
  }

  organiserJobTitle = val(it.organizer.jobTitle || it.organizer.title || it.organizer.role || '');
  organiserOrganisation = val(
    it.organizer.organisation || it.organizer.organization || it.organizer.company || it.organizer.companyName || ''
  );
}

// ---------- fallbacks from flat fields ----------
if (!organiserFullName) {
  organiserFullName =
    val(it.organiserName) ||
    val(it.organizerName) ||
    val(it.organiserFullName) ||
    val(it.organizerFullName) ||
    val(it.hostName) ||
    val(it.chairName) ||
    '';
}
if (!organiserEmail) {
  organiserEmail =
    low(val(it.organiserEmail)) ||
    low(val(it.organizerEmail)) ||
    '';
}
if (!organiserJobTitle) {
  organiserJobTitle =
    val(it.organiserRole) ||
    val(it.organizerRole) ||
    val(it.organiserTitle) ||
    val(it.organizerTitle) ||
    val(it.hostTitle) ||
    val(it.chairTitle) ||
    '';
}
if (!organiserOrganisation) {
  organiserOrganisation =
    val(it.organiserOrganisation) ||
    val(it.organizerOrganization) ||
    val(it.organiserCompany) ||
    val(it.organiserCompanyName) ||
    pickFirst(it.inferredCompanyNames) ||
    '';
}
if (!organiserOrganisation && organiserEmail) {
  organiserOrganisation = inferOrgFromEmail(organiserEmail);
}

// ---------- secondary fallback: infer organiser from attendees (first internal) ----------
if (!organiserEmail && !organiserFullName) {
  // Use arrays if present (Graph also has attendees array of objects, but we’ll align with your arrays for speed)
  const attendeeEmails  = getIndexedArray(it, 'attendeeEmails').map(e => low(val(e))).filter(Boolean);
  const attendeeNames   = getIndexedArray(it, 'attendeeNames').map(n => val(n));
  const externalEmails  = getIndexedArray(it, 'externalAttendeeEmails').map(e => low(val(e))).filter(Boolean);
  const externalSet = new Set(externalEmails);

  // Pick the first attendee who is NOT external
  for (let i = 0; i < Math.max(attendeeEmails.length, attendeeNames.length); i++) {
    const em = attendeeEmails[i] || '';
    if (!em || externalSet.has(em)) continue;

    organiserEmail = em;

    const nmRaw = attendeeNames[i] || '';
    const nm = nmRaw && !looksEmail(nmRaw) ? nmRaw : '';
    organiserFullName = nm;

    if (!organiserOrganisation) organiserOrganisation = inferOrgFromEmail(organiserEmail);
    break;
  }

  // If still nothing, try Graph attendees array of objects
  if (!organiserEmail && Array.isArray(it.attendees)) {
    for (const a of it.attendees) {
      const ea = a?.emailAddress;
      const addr = low(val(ea?.address));
      if (!addr) continue;
      // If externals are known, skip them
      if (externalEmails.length && externalSet.has(addr)) continue;

      organiserEmail = addr;
      organiserFullName = organiserFullName || val(ea?.name || ea?.displayName || '');
      organiserOrganisation = organiserOrganisation || inferOrgFromEmail(addr);
      break;
    }
  }
}

// ---------- build names ----------
const { firstName: organiserFirstName, lastName: organiserLastName } = splitName(organiserFullName);

// ---------- validate & return ----------
if (!organiserEmail && !organiserFullName) {
  return [{
    json: {
