    organiserJobTitle,
    organiserEmail,
    organiserOrganisation,
    subject,
    meetingId,
    start,
    end,
    timeZone
  }
}];

// Input: one item per meeting with arrays like:
// attendeeNames, attendeeEmails, externalAttendeeEmails, subject, ...
// Output: one item per INTERNAL attendee (excluding organiser & externals)

const it = $input.item.json;

const names  = Array.isArray(it.attendeeNames)  ? it.attendeeNames  : [];
const emails = Array.isArray(it.attendeeEmails) ? it.attendeeEmails : [];

const externalEmails = Array.isArray(it.externalAttendeeEmails)
  ? it.externalAttendeeEmails.map(e => (typeof e === 'string' ? e.trim().toLowerCase() : ''))
  : [];

const organiserEmail = (it.organiserEmail || it.organizerEmail || '').toLowerCase().trim();

const out = [];

const norm = s => (typeof s === 'string' ? s.trim() : '');
const looksEmail = s => /@/.test(s);

function splitName(fullName) {
  const parts = (fullName || '').trim().split(/\s+/).filter(Boolean);
  if (!parts.length) return { firstName: '', lastName: '' };
  if (parts.length === 1) return { firstName: parts[0], lastName: '' };
  return { firstName: parts[0], lastName: parts.slice(1).join(' ') };
}

function orgFromEmail(email) {
  const m = (email || '').toLowerCase().match(/@([^@]+)$/);
  if (!m) return '';
  const domain = m[1]; // e.g. legalengine.co.uk or simmons-simmons.con
  const firstLabel = domain.split('.')[0]; // legalengine / simmons-simmons
  // Title-case hyphen-separated words: "simmons-simmons" -> "Simmons Simmons"
  return firstLabel
    .split('-')
    .filter(Boolean)
    .map(w => w.charAt(0).toUpperCase() + w.slice(1))
    .join(' ');
}

const externalSet = new Set(externalEmails.filter(Boolean));
const seen = new Set(); // dedupe by email

for (let i = 0; i < Math.max(names.length, emails.length); i++) {
  const emailRaw = emails[i] ?? '';
  const email = emailRaw.toLowerCase().trim();
  if (!email) continue;

  // Exclude externals & organiser
  if (externalSet.has(email)) continue;
  if (organiserEmail && email === organiserEmail) continue;

  // Dedupe
  if (seen.has(email)) continue;
  seen.add(email);

  // Name handling: ignore if it looks like an email
  const nameRaw = norm(names[i] ?? '');
  const fullName = nameRaw && !looksEmail(nameRaw) ? nameRaw : '';
  const { firstName, lastName } = splitName(fullName);

  out.push({
    json: {
      subject: it.subject ?? it.meetingSubject ?? '',
      fullName,
      firstName,
      lastName,
      role: '', // no role available in this input
      email,
      organisation: orgFromEmail(email),

      // pass-throughs if useful
      meetingId: it.id ?? it.meetingId ?? '',
      start: it.start ?? it.startISO ?? '',
      end: it.end ?? it.endISO ?? '',
    }
  });
}

return out.length ? out : [{ json: { warning: "No internal attendees to process" } }];
